export const WalletModal: React.FC<BaseModalProps> = ({
  open,
  loading,
  handleClose,
  onSave,
  title = "Connect a wallet",
  buttonText = "Send",
}) => {
  const { wallets, activeWallet, activeAccount } = useWallet();
  return (
    <Modal
      open={open}
      onClose={handleClose}
      aria-labelledby="address-modal-title"
      aria-describedby="address-modal-description"
    >
      <Box
        sx={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "100vh",
        }}
      >
        <div className="modal">
          <button className="close-btn" onClick={handleClose}>
            <CloseSquareWrapper />
          </button>
          <Stack className="body" spacing={7}>
            <div className="container">
              <Header />
            </div>
            <Terms />
            <Row>
              {wallets.map((wallet, index) => (
                <Available
                  key={wallet.id}
                  className={
                    index === 0
                      ? "available-fst"
                      : index === wallets.length - 1
                      ? "available-lst"
                      : ""
                  }
                  onClick={(ev) => {
                    ev.preventDefault();
                    wallet.connect().then(() => {
                      handleClose();
                    });
                  }}
                >
                  <AvailableContent>
                    <ContentIcon>
                      <IconContainer>
                        <img
                          src={wallet.metadata.icon}
                          alt={wallet.metadata.name}
                        />
                      </IconContainer>
                    </ContentIcon>
                    <AvilableBody>
                      <AvailableTitle>{wallet.metadata.name}</AvailableTitle>
                    </AvilableBody>
                  </AvailableContent>
                </Available>
              ))}
            </Row>
          </Stack>
        </div>
      </Box>
    </Modal>
  );
};

export default WalletModal;
